import React from "react";
import { Link } from "react-router-dom";
// import "./style.css";
function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <Link className="navbar-brand" to="/">
        Start Game
      </Link>
      <Link
        to="/discover"
        className={
          window.location.pathname === "/discover"
            ? "nav-link active"
            : "nav-link"
        }
      >
        Discover
      </Link>
    </nav>
  );
}
export default Navbar;
